import { useState, useCallback, useEffect } from "react";
import imgUrl from "../assets/ic_heart.png";
import arrow_left from "../assets/arrow_left.png";
import arrow_right from "../assets/arrow_right.png";
import search from "../assets/ic_search.png";
import dropdown from "../assets/ic_arrow_down.png";
import styles from "./HomePage.module.css";

function HomePage() {
  const [isOpen, setIsOpen] = useState(false);
  const [products, setProducts] = useState([]);
  const [bestProducts, setBestProducts] = useState([]);

  const handleButtonClick = useCallback((e) => {
    e.stopPropagation();
    setIsOpen((prev) => !prev);
  }, []);

  // 상품 데이터 가져오기
  const fetchProducts = async () => {
    const response = await fetch(
      "https://panda-market-api.vercel.app/products"
    );
    const data = await response.json();
    console.log("Products: ", data); // 데이터를 확인하기 위한 로그 추가

    // 데이터가 배열인지 확인
    if (Array.isArray(data)) {
      setProducts(data); // 배열일 경우에만 상태를 업데이트
    } else {
      console.error("상품 데이터가 배열이 아닙니다.");
    }
  };

  // 베스트 상품 데이터 가져오기
  const fetchBestProducts = async () => {
    const response = await fetch(
      "https://panda-market-api.vercel.app/products?sort=favorite"
    );
    const data = await response.json();
    console.log("Best Products: ", data); // 데이터를 확인하기 위한 로그 추가

    // 데이터가 배열인지 확인
    if (Array.isArray(data)) {
      setBestProducts(data); // 배열일 경우에만 상태를 업데이트
    } else {
      console.error("베스트 상품 데이터가 배열이 아닙니다.");
    }
  };

  useEffect(() => {
    fetchProducts();
    fetchBestProducts();
  }, []);

  useEffect(() => {
    const handleClickOutside = () => setIsOpen(false);
    if (isOpen) {
      window.addEventListener("click", handleClickOutside);
    }
    return () => {
      window.removeEventListener("click", handleClickOutside);
    };
  }, [isOpen]);

  return (
    <>
      <div className={styles.best}>
        <h1>베스트 상품</h1>
        <div className={styles.flexbox}>
          {/* bestProducts가 배열일 경우에만 slice 적용 */}
          {bestProducts &&
            Array.isArray(bestProducts) &&
            bestProducts.slice(0, 4).map((product) => (
              <div key={product.id}>
                <img
                  src={product.images}
                  alt={product.name}
                  className={styles.img}
                />
                <p className={styles.title}>{product.name}</p>
                <p className={styles.price}>{product.price}원</p>
                <p className={styles.zzim}>
                  <img src={imgUrl} alt="heart" className={styles.icon} />
                  <span className={styles.heart}>{product.favoriteCount}</span>
                </p>
              </div>
            ))}
        </div>
      </div>

      <div className={styles.product}>
        <div className={styles.box}>
          <h1>판매 중인 상품</h1>
          <div className={styles.flex}>
            <img src={search} alt="search icon" />
            <input placeholder="검색할 상품을 입력해주세요"></input>
            <button>상품 등록하기</button>
            <div className={styles.dropdownMenu} onClick={handleButtonClick}>
              <p className={styles.dropdown}>
                최신순
                <img src={dropdown} alt="dropdown icon" />
              </p>
              {isOpen && (
                <ul className={styles.popup}>
                  <li>최신순</li>
                  <li>좋아요순</li>
                </ul>
              )}
            </div>
          </div>
        </div>
        <div className={styles.flexbox}>
          {/* products가 배열일 경우에만 slice 적용 */}
          {products &&
            Array.isArray(products) &&
            products.slice(0, 10).map((product) => (
              <div key={product.id}>
                <img
                  src={product.images}
                  alt={product.name}
                  className={styles.img2}
                />
                <p className={styles.title}>{product.name}</p>
                <p className={styles.price}>{product.price}</p>
                <p className={styles.zzim}>
                  <img src={imgUrl} alt="heart" className={styles.icon} />
                  <span className={styles.heart}>{product.favoriteCount}</span>
                </p>
              </div>
            ))}
        </div>
      </div>

      <div className={styles.pagination}>
        <button>
          <img src={arrow_left} />
        </button>
        <button>1</button>
        <button>2</button>
        <button>3</button>
        <button>4</button>
        <button>5</button>
        <button>
          <img src={arrow_right} />
        </button>
      </div>
    </>
  );
}

export default HomePage;
